import React from "react";

export default function Navbar() {
  return (
    <header>
      <div>
        <div>
          <i className="fa-brands fa-reddit">Reddit</i>
        </div>
        <nav>
          <ul>
            <li>
            <button>Log In</button></li>
            <li></li>
            <i class="fa-regular fa-user"></i>
          </ul>
        </nav>
      </div>
    </header>
  );
}
